用ES5重写startsWith和endsWith

银行等企业使用浏览器内核版本不是太高，而且多为IE，导致有些ES6方法不能兼容，发现了两个ES6方法，因为很简单所以利用ES5重新实现了一下

1. startsWith
/*
* @param searchVal 必需，要查找的字符串。
* @param start 可选，查找的开始位置，默认为 0。
*/
String.prototype.startsWith = function(searchVal, start) {
    start = start === undefined ? 0 : start;
    return this.substr(start, 1) === searchVal;
}

2. endsWith
/*
* @param searchVal 必需，要查找的字符串。
*/
String.prototype.endsWith = function(searchVal) {
    return this.substr(-1, 1) === searchVal;
}

doc/JavaScript/3.继承.html.body:
js中每个类都有三个部分：

构造函数内的，这是供实例化对象复制用的
构造函数外的，直接通过点语法添加的，这是供类使用的，实例化对象访问不到
类的原型上的，实例化对象可以通过其原型链间接访问到，供所有实例化对象共用
然而，继承中所涉及的不仅仅是一个对象，并且js也没有继承这一现有的机制，那它如何实现的呢？1.类式继承
// 声明父类
function SuperClass() {
 this.superValue = true;
}
// 父类添加共有方法
SuperClass.prototype.getSuperValue = function(){
 return this.superValue;
};
// 声明子类
function SubClass() {
 this.subValue = false;
}
// 继承父类
SubClass.prototype = new SuperClass();
// 为子类添加共有方法
SubClass.prototype.getSubValue = function(){
 return this.subValue;
};
var instance1 = new SubClass();
console.log(instance.getSuperValue()); // true
console.log(instance.getSubValue()); // false




通常说这种继承方式有两个缺点：

由于子类通过其原型prototype对父类实例化，继承了父类。所以父类中的共有属性如果是引用类型，就会在子类中被所有实例共用，因此一个子类的实例在修改从父类构造函数中继承来的共有属性时，就会直接影响到其他的子类。
由于子类实现的继承是通过其原型prototype对父类的实例化实现的，因此在创建父类的时候，是无法向父类传递参数的，因而在实例化父类的时候也无法对父类构造函数内的属性进行初始化。


2.构造函数继承
// 声明父类
function SuperClass(id) {
    this.books = ['js', 'html', 'css'];
    this.id = id;
}
SuperClass.prototype.showBooks = function () {
    console.log(this.books);
}
// 声明子类
function SubClass (id) {
    SuperClass.call(this, id);
}
var instance1 = new SubClass(10);
var instance2 = new SubClass(11);
instance1.books.push('设计模式');
console.log(instance1.books); // ['js', 'html', 'css', '设计模式']
console.log(instance1.id); // 10
console.log(instance2.books); // ['js', 'html', 'css']
console.log(instance2.id); // 11
console.log(instance1.showBooks()); // TypeError


缺点：
SuperClass.call(this, id);是构造函数式继承的精华，由于这种类型的继承没有涉及原型prototype，所以父类的原型方法不会被子类继承。而如果想被子类继承就必须要放在构造函数中，这样创建出来的每个实例就会单独拥有一份而不能共用，这样就违背了代码复用原则。

3.组合继承
// 声明父类
function SuperClass(name) {
    this.books = ['js', 'html', 'css'];
    this.name = name;
}
SuperClass.prototype.getName = function () {
    console.log(this.name);
}
// 声明子类
function SubClass (name, time) {
    SuperClass.call(this, name);
    this.time = time;
}
SubClass.prototype = new SuperClass();
subClass.prototype.getTime = function() {
    console.log(this.time);
}
var instance1 = new SubClass('js book', 2014);
instance1.books.push('设计模式');
console.log(instance1.books); // ['js', 'html', 'css', '设计模式']
instance1.getName(); // js book
instance2.getTime(); // 2014 
var instance2 = new SubClass('css book', 2011);
console.log(instance2.books); // ['js', 'html', 'css']
instance2.getName(); // css book
instance2.getTime(); // 2011


缺点：
在使用构造函数继承时执行了一遍父类的构造器，而在实现子类原型的类式继承时又调用了一遍父类构造函数，因此父类构造函数调用了两遍。

4.原型式继承
function inheritObject(o) {
    // 声明一个过渡函数对象
    function F() {}
    // 过渡对象的原型继承父对象
    F.prototype = o;
    // 返回过渡对象的实例，该实例的原型继承了父对象
    return new F();
}


它是对类式继承的一种封装，类式继承中的问题在这里也会存在，不过这种方式由于F过渡类的构造函数中无内容，所以开销比较小，使用起来比较方便。如果你觉得有必要可以将F过渡类缓存起来，不必每次创建一个新过渡类F。当然这种顾虑也是不必要的，随着这种思想的深入，后来就出现了Object.create()方法。
Object.create()方法创建一个新对象，使用现有的对象来提供新创建的对象的__proto__。
MDN链接：https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Object/create

5.寄生式继承
function inheritObject(o) {
    // 声明一个过渡函数对象
    function F() {}
    // 过渡对象的原型继承父对象
    F.prototype = o;
    // 返回过渡对象的实例，该实例的原型继承了父对象
    return new F();
}
// 声明基对象
